INSERT INTO `email` VALUES ('9455b286-f60d-4d2d-9ad4-14aaceb483e5', '东旭工作室报名表', '[] <2085374907@qq.com>', '2755004257 <2755004257@qq.com>', NULL, '&nbsp;\r\n \r\n计算机学院2024-2025学年团学组织纳新报名表\r\n                        \r\n姓 名\r\n                       \r\n吴霞怡\r\n                       \r\n性 别\r\n                       \r\n女\r\n                       \r\n年级\r\n         \r\n班级\r\n                       \r\n24-1\r\n                       \r\n\r\n            \r\n                     \r\n政治面貌\r\n                       \r\n群众\r\n                       \r\n所在寝室\r\n                       \r\n闻潮b250\r\n                       \r\nQQ\r\n                       \r\n2085374907\r\n            \r\n                     \r\n联系方式\r\n                       \r\n13073628255\r\n                       \r\n服从调配\r\n                       \r\n不服从调剂\r\n            \r\n                     \r\n报名团学部门\r\n                       \r\n第一志愿： \r\n            \r\n                     \r\n第二志愿： \r\n            \r\n                     \r\n第三志愿： \r\n            \r\n                     \r\n报名社团\r\n                       \r\n第一志愿：东旭工作室\r\n            \r\n                     \r\n第二志愿： \r\n            \r\n                     \r\n第三志愿： \r\n            \r\n                     \r\n个\r\n         \r\n人\r\n         \r\n简\r\n         \r\n介\r\n                       \r\n我是吴霞怡，计算机科学与技术学院人工智能专业2班的24级新生，爱好是搭积木，看书，擅长表达（可能），时e时i，学过python，具备良好的适应能力，情绪稳定，能与各个部门进行友好的交流与沟通，关于我为什么想加入部门，一是为了锻炼自己，提升自己的能力，积攒实践经验，二是希望能够多学习知识，同时我也希望在该部门认识更多志同道合的朋友，让大学生活丰富多彩\r\n            \r\n                     \r\n个\r\n         \r\n人\r\n         \r\n荣\r\n         \r\n誉\r\n                       \r\n市级英语演讲比赛中斩获一等奖\r\n         \r\n荣获“学习标兵”称号\r\n         \r\n&nbsp;\r\n            \r\n                     \r\n相\r\n         \r\n关\r\n         \r\n经\r\n         \r\n历\r\n                       \r\n1.制定了详细的学习计划，每天坚持早起背诵英语单词\r\n         \r\n2.高考考了python\r\n         \r\n3.报名参加了英语口语强化班，经过一段时间的学习和训练，英语口语表达能力有了显著提升。\r\n            \r\n    \r\n \r\n说明：电子版写即可，递交给副班，时间截止至9.16日晚20：00<meta http-equiv=\"Content-Type\" content=\"text/html; charset=GB18030\"><div><div style=\"overflow-wrap: normal; font-size: 1em; line-height: normal;\" class=\"qmbox0\"><div><div class=\"qmbox qmbox\">                    \n  \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    <!-- [if !mso]>\n      <style></style>\n    <![endif] -->\n    <!-- [if gte mso 9]>\n      <xml>\n        <o:DocumentProperties>\n          <o:Author>余信</o:Author>\n          <o:LastAuthor>霞怡 吴</o:LastAuthor>\n          <o:TotalTime>600</o:TotalTime>\n          <o:Created>2024-09-15T22:54:00Z</o:Created>\n          <o:LastSaved>2024-09-18T12:30:00Z</o:LastSaved>\n          <o:Revision>4</o:Revision>\n        </o:DocumentProperties>\n        <o:CustomDocumentProperties>\n          <o:KSOProductBuildVer dt:dt=\"string\">2052-11.1.0.14309</o:KSOProductBuildVer>\n          <o:ICV dt:dt=\"string\">49ef2a983b1140e5b0a979b59012a9ad_23</o:ICV>\n        </o:CustomDocumentProperties>\n      </xml>\n    <![endif] -->\n    <!-- [if gte mso 9]>\n      <xml>\n        <w:WordDocument>\n          <w:View>Print</w:View>\n          <w:Zoom>100</w:Zoom>\n          <w:PunctuationKerning></w:PunctuationKerning>\n          <w:DoNotOptimizeForBrowser></w:DoNotOptimizeForBrowser>\n          <w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing>\n          <w:DrawingGridHorizontalSpacing>0.05 磅</w:DrawingGridHorizontalSpacing>\n          <w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery>\n          <w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery>\n          <w:Compatibility>\n            <w:ULTrailSpace></w:ULTrailSpace>\n            <w:AdjustLineHeightInTable></w:AdjustLineHeightInTable>\n            <w:BalanceSingleByteDoubleByteWidth></w:BalanceSingleByteDoubleByteWidth>\n            <w:DoNotExpandShiftReturn></w:DoNotExpandShiftReturn>\n            <w:BreakWrappedTables></w:BreakWrappedTables>\n          </w:Compatibility>